import React from 'react';
import { Link } from "react-router-dom";
import NewChat from './NewChat';
import JoinChat from './JoinChat';

const Home = () => {
  return (
    <>
    <h2>My Chat App</h2>
    <Link to="chats/new">New Chat</Link> <br /> <br />
    <Link to="chats/join">Join Chat</Link>
    </>
  )
}

export default Home
